export type ID = { input: string; output: string };
export type String = { input: string; output: string };
export type Boolean = { input: boolean; output: boolean };
export type Int = { input: number; output: number };
export type Float = { input: number; output: number };
export type Timestamp = { input: Date; output: number | Date };
export type Object = { input: unknown; output: unknown };
